import React from 'react';
import "../styles/Projects.css";
import ProjectItem from '../components/ProjectItem';
import MentorMatcher from '../assets/mentormatcher.png';
import TealEvents from '../assets/tealevents.png';
import { ProjectList } from "..helpers/ProjectList";

function Work() {
    return (<div className="work">
        <div className="bg">
            <img className="background" src="../assets/white_bg.jpg" alt=""/>

        </div>

        <h1 className="title">My Work</h1>
        <div className="projectList">
            {ProjectList.map}
        </div>

    </div>);
}

export default Work;
